INSERT INTO `blog_body` (`blog_id`, `blog_detail`) VALUES
(2, 'Equipment and auto finance organizations have been slower than many other lenders to adopt cloud—the average bank today has more than half of its workload in the cloud, according to Accenture’s report, “The Cloud Imperative for Banking”. Now that customers essentially expect lenders and lessors to offer seamless, digital services, because of market changes driven by the COVID-19 pandemic, many are trying to catch up.\r\n\r\nCOVID-19 exposed critical gaps in business tools, systems and processes. In what the World Economic Forum has called “The Great Reset”, auto and equipment finance organizations have a unique opportunity to question business as usual and rethink how they serve customers who are unlikely to give up their preference for more convenient, digital services post-pandemic. Would you?\r\n\r\nWhy do auto and equipment finance organizations balk at the cloud when it offers something better for less money? In October, I was part of a panel discussing whether emerging technologies such as artificial intelligence and the Internet of Things were hype or reality for equipment finance. Cloud could easily have been part of that discussion. When it comes to cloud, there is still some skepticism around security, regulatory ambiguity, potential competitive issues with the largest cloud service providers and, of course, the cost.'),
(3, '    Middle market bank leaders are having a debate with themselves. They need to improve their numbers. But they know that the downside of slash-and-burn cost cutting is that costs come back like weight lost on a fad diet. But the pandemic and the economic outlook make uncertainty the only thing that feels certain these days.\r\n    Even so, leaders must demonstrate cost savings to shareholders. This can make slashing and burning costs look pretty appealing. But I advise middle market bank leaders to avoid this temptation. Lasting cost savings never come from frenzied, one-time cuts that focus on laying people off, introducing hiring freezes or canceling projects. This simply isn’t sustainable. After all, short-term thinking leads to short-term results. Banks end up stuck in a vicious “groundhog day” cycle of cost cutting that hurts the customer experience. And as customers leave in frustration, they take future revenue with them.'),
(4, 'For the last 20 years, the most predictable thing about the payments industry was that it was unpredictable. Disruption has been going on for so long that it’s now hard to remember what so-called “normal” times were like—and the changes show no sign of slowing down.\r\n\r\nBut the disruption will not be evenly distributed, either by geography or industry segment. Some markets will be highly volatile where others will merely be vulnerable. A few pockets of the industry may even be relatively calm and durable.\r\n\r\nIn this series of posts, we’re going to explore Accenture’s new Payments Disruptability Index, which provides insight into the tumultuous present and future of the industry.\r\n\r\nBut before we jump into the specific findings in the index, we need to understand the forces driving the disruption.\r\n\r\nThe most powerful shockwave roiling payments right now is the same one that’s reshaped global society since the spring of 2020: the coronavirus pandemic. From a payments perspective, the most salient aspect of the pandemic is how it is changing consumer behaviour and business sentiments. These are likely to act as an accelerant on the other disruptive trends that were already reshaping payments before the outbreak.'),
(5, 'There’s no two ways about it: ISO 20022 is a complex new standard for financial services firms of every description. Inside that complexity lie some operational hurdles for payments players—but also tremendous opportunities.\r\n\r\nWe can see why by looking at the ISO 20022 message format, which neatly encapsulates the high-level impact of the new standard. The format will allow, for the first time, rich business data to travel alongside a payment, end-to-end from the originator to the beneficiary systems.\r\n\r\nThe first is payments trend analysis. ISO 20022 enables radically improved payments trends analytics and predictions for corporate customers. By analysing fields like payment method, number of transactions, amount, and requested execution date, insights into the average values and volumes of payments made by each corporate customer can be improved. This provides crucial inputs into cash flow management strategies.\r\n\r\nThe second is liquidity trends and projections. As corporate customers expand into new markets, boosting the volumes of domestic and cross-border transactions, the requirement for banks to provide quick and easy access to liquidity, and to mobilise this across geographies, becomes ever more important. ISO 20022 allows easy and simplified reporting on the overview position of receivables and payables by currency, as well as insights into the average value of payments, based on historic data, to improve projections for the days ahead. Monitoring and projecting trends is enhanced by both.\r\n\r\nThe third is purpose assessment and hyper-personalisation. Code assessments of transaction purpose categories from ISO 20022 messages enable the analysis of categories and the frequency of transactions. This in turn makes it easy to identify cross-selling and up-selling opportunities.'),
(8, 'The weather is likely to be unstable for banks in 2020, with a high probability of storms in places. Several continuing and new indicators suggest so—from banking consolidation, Open Banking and AI to eager big-tech entrants, revenue migration and purpose-driven banking.\r\n\r\n\r\nDrawing on input from our “weather” observation points—the many banks and industry tech providers around the world with which we work—I compiled the top 10 trends that are currently shaping conditions for retail and commercial banks. These trends may veer left or right from my predictions as they move through the industry, but hopefully they will give bankers a sense of what they should watch and plan for over the next 12 months.');

